column32:
{quote}Comunicar times


Foi identificado que os _deeplinks_ de cartão nao redirecionavam corretamente no app. Segue relato sobre o problema:{quote}

{quote}O que tá ocorrendo com do deeplink: Basicamente a solução que fizemos para navegação alinhada tem uma limitação, que inclusive já havíamos comentado, caso dois módulos criem a estrutura contendo o TabNavigation eles vão acabar sobrescrevendo um ao outro.

*E percebi que o módulo de account-statements implementou recentemente, o que acabou sobrescrevendo a nossa implementação. Isso confirma o problema do deeplink estar funcionando e depois de quinta parar de funcionar, foi quando o pessoal de account-statements subiu essa alteração.*{quote}

O {{client-app-onboarding}} e o {{service-customer}} estão aceitando receber datas de nascimento que não estão no padrão de formato ISO. Por exemplo: {{200-08-05}}

Exemplo do registro no {{service-customer}} no [Sentry|https://meliuz.sentry.io/issues/4151611244/?project=187730&referrer=slack].

Nós precisamos garantir que os valores enviados estejam corretos, e penso que isso precisa ser realizado tanto no {{client-app-onboarding}} quando no {{service-customer}}.

Time de segurança reportou que a expiração de senha não estava funcionando.

Ao aprofundarmos em conjunto identificamos que a senha expirada está bloqueando o login no app apenas, mas no site está deixando se logar na conta do usuário.



Esse comportamento pode ser verificado no {{service-auth}} no arquivo {{app/modules/oauth/commands/grant_types/password.py}} e no arquivo {{app/modules/customer/password/commands/verify_expired.py}}
